import React from "react";
import Axios from "axios";

export default class EmployeeCountComponent extends React.Component {
    constructor() {
        super();
        this.state = {
            length: 0
        }
    }
    render() {
        return (
            <div>
                <h1>Total Employee Count: {this.state.length}</h1>
            </div>
        )
    }   

    componentDidMount() {
        Axios.get("https://5a530e1477e1d20012fa066a.mockapi.io/login").then((response) => {
            this.setState({
                length: response.data.length
            })
        })
    }
}
